import { BrowserRouter,Routes,Route } from 'react-router-dom';
import './App.css';
import Navbar from './Components/Navbar';
import Footer from './Components/Footer';
import Home from './Components/Home';

function App() {
  return (
    <BrowserRouter>
        <Navbar />
        <Routes>
          <Route path='/all' element={<Home q="/all"/>}/>
          <Route path='/cricket' element={<Home q="/cricket"/>}/>
          <Route path='/politics' element={<Home q="/all"/>}/>
          <Route path='/technologies' element={<Home q="/all"/>}/>
          <Route path='/science' element={<Home q="/all"/>}/>
          <Route path='/story' element={<Home q="/all"/>}/>
        </Routes>
        <Footer />
    </BrowserRouter>
  );
}

export default App;
